import React, { useState } from "react";
import { motion } from "framer-motion";
import { useNavigate } from "react-router-dom";

const CropPrediction = () => {
    const [formData, setFormData] = useState({
        N: "",
        P: "",
        K: "",
        temperature: "",
        humidity: "",
        ph: "",
        rainfall: "",
    });

    const navigate = useNavigate();

    const [recommendedCrop, setRecommendedCrop] = useState(null);
    const [cropImage, setCropImage] = useState(null);
    const [cropDescription, setCropDescription] = useState(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const [formShifted, setFormShifted] = useState(false);

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setRecommendedCrop(null);
        setError(null);
        setLoading(true);

        try {
            const response = await fetch("http://localhost:5000/api/auth/predict", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify({
                    N: parseFloat(formData.N),
                    P: parseFloat(formData.P),
                    K: parseFloat(formData.K),
                    temperature: parseFloat(formData.temperature),
                    humidity: parseFloat(formData.humidity),
                    ph: parseFloat(formData.ph),
                    rainfall: parseFloat(formData.rainfall),
                }),
            });

            const data = await response.json();
            setLoading(false);

            if (response.ok) {
                setRecommendedCrop(data.recommended_crop);
                setCropImage(data.image); // Assuming backend returns an image URL
                setCropDescription(data.description);
                setFormShifted(true);
            } else {
                setError(data.message || "Error predicting crop");
            }
        } catch (err) {
            setLoading(false);
            setError("Failed to connect to the backend");
        }
    };

    return (
        <div style={styles.pageContainer}>
            {/* Home Button */}
            <button onClick={() => navigate("/home")} style={styles.homeButton}>
                ‚¨Ö Home
            </button>

            {/* Form Animation */}
            <motion.div
                style={{
                    ...styles.container,
                    left: formShifted ? "-20%" : "0",
                    position: "relative",
                }}
                initial={{ x: 0, opacity: 1 }}
                animate={{
                    x: formShifted ? "-50%" : 0,
                    opacity: 1,
                }}
                transition={{ duration: 0.5 }}
            >
                <h1 style={styles.header}>üå± Crop Prediction</h1>

                <form style={styles.form} onSubmit={handleSubmit}>
                    <div style={styles.row}>
                        {["N", "P", "K"].map((key) => (
                            <div key={key} style={styles.inputGroup}>
                                <label style={styles.label} htmlFor={key}>
                                    {key}:
                                </label>
                                <input
                                    type="number"
                                    id={key}
                                    name={key}
                                    value={formData[key]}
                                    onChange={handleChange}
                                    style={styles.input}
                                    required
                                />
                            </div>
                        ))}
                    </div>

                    {["temperature", "humidity", "ph", "rainfall"].map((key) => (
                        <div key={key} style={styles.inputGroup}>
                            <label style={styles.label} htmlFor={key}>
                                {key.charAt(0).toUpperCase() + key.slice(1)}:
                            </label>
                            <input
                                type="number"
                                id={key}
                                name={key}
                                value={formData[key]}
                                onChange={handleChange}
                                style={styles.input}
                                required
                            />
                        </div>
                    ))}

                    <motion.button
                        type="submit"
                        style={styles.submitButton}
                        disabled={loading}
                        whileHover={{ scale: 1.05 }}
                        whileTap={{ scale: 0.95 }}
                    >
                        {loading ? "Predicting..." : "Predict Crop"}
                    </motion.button>
                </form>
            </motion.div>

            {/* Prediction Result */}
            {recommendedCrop && (
                <motion.div
                    style={styles.resultContainer}
                    initial={{ opacity: 0, x: 50 }}
                    animate={{ opacity: 1, x: 0 }}
                    transition={{ duration: 0.5 }}
                >
                    <h2 style={styles.result}>üåæ Recommended Crop:</h2>
                    <p style={styles.cropName}>{recommendedCrop}</p>
                    {cropImage && (
                        <motion.img
                            src={cropImage}
                            alt={recommendedCrop}
                            style={styles.cropImage}
                            initial={{ scale: 0.8, opacity: 0 }}
                            animate={{ scale: 1, opacity: 1 }}
                            transition={{ duration: 0.5 }}
                        />
                    )}
                    {cropDescription && (
                        <p style={styles.cropDescription}>{cropDescription}</p>
                    )}
                </motion.div>
            )}

            {error && (
                <motion.div
                    style={styles.errorContainer}
                    initial={{ opacity: 0, scale: 0.8 }}
                    animate={{ opacity: 1, scale: 1 }}
                    transition={{ duration: 0.3 }}
                >
                    <h2 style={styles.error}>‚ö†Ô∏è {error}</h2>
                </motion.div>
            )}
        </div>
    );
};

const styles = {
    ...yourExistingStyles,
    cropImage: {
        width: "100px",
        height: "100px",
        objectFit: "cover",
        borderRadius: "8px",
        marginTop: "10px",
    },
    cropDescription: {
        fontSize: "16px",
        color: "#ff7b42",
        marginTop: "10px",
        textAlign: "center",
    },
};

export default CropPrediction;
